import axios from "axios";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

function Forgotpassword(){
    const setBackgroundImage = () => {
        document.querySelector('.backgroundimg').style.backgroundImage = "url('http://localhost:5000/img/rover.jpg')";
        document.querySelector('.backgroundimg').style.backgroundSize = "cover";
    };
    setBackgroundImage();
    const nav = useNavigate()
    const [Data,Setdata] = useState({
        'email':'',
        'newpass':'',
        'cnfnewpass':''
    })
    const [upper, setupper] = useState(0)
    const [lower, setlower] = useState(0)
    const [spc, setspc] = useState(0)
    const [num, setnum] = useState(0)
    const [len, setlen] = useState(0)
    const sp = "~@`!#$%^&*+=-[]()_.';,/{}|\":<>?";
    const checkpass = (e) => {
        var upper = 0;
        var lower = 0;
        var spc = 0;
        var num = 0;
        var x = e.target.value;
        for (var i=0;i<x.length;i++){
            if(x[i]===x[i].toUpperCase() && isNaN(x[i]) && !(sp.includes(x[i]))){
                upper+=1;
            }else if(x[i]===x[i].toLowerCase() && isNaN(x[i]) && !(sp.includes(x[i]))){
                lower++;
            }else if(sp.includes(x[i])){
                spc++;
            }else{
                num++;
            }
        }
        setupper(upper)
        setlower(lower)
        setspc(spc)
        setnum(num)
        setlen(x.length)
        // console.log(upper)
        // console.log(lower)
        // console.log(spc)
        // console.log(num)
        // console.log(x)
    }
    const [otp,setnewotp] = useState(0);
    const Resetpassword=(e)=>{
        e.preventDefault()
        if(Data.email===""){
            // e.preventDefault()
            alert('Enter Your Email')
        }else if(Data.newpass===''){
            // e.preventDefault()
            alert('Create A New Password')
        }else if(upper===0){
            // e.preventDefault()
            alert('Password Must Contain One Captal Letter')
        }else if(lower===0){
            // e.preventDefault()
            alert('Password Must Contain One Lower Letter')
        }else if(spc===0){
            // e.preventDefault()
            alert('Password Must Contain One Special Character')
        }else if(num===0){
            // e.preventDefault()
            alert('Password Must Contain One Number')
        }else if(len<8){
            // e.preventDefault()
            alert('Password Must Contain Atleast 8 Characters')
        }else if(Data.cnfnewpass===''){
            // e.preventDefault()
            alert('Re-Enter Your New Password')
        }else if(Data.newpass!=Data.cnfnewpass){
            // e.preventDefault()
            alert('Password Mismatch')
        }else{
            // alert(Data.email)
            const mailid = Data.email;
            axios.get(`http://localhost:5000/forgotpassword/${mailid}`).then((res)=>{
                if(res.data){
                    setnewotp(res.data)
                    alert(otp)
                }else{
                    alert('Account Not Found')
                }
            })
        }    
    }
    return(
        <>
            <div style={{marginLeft:'12%',textAlign:'center'}} id="loginblock">
                <input id="loginblock2" type="email" placeholder="Enter Your Email" onChange={(e)=>Setdata({...Data,email:e.target.value})}/><br/><br/>
                <input id="loginblock2" type="password" placeholder="Enter A New Password" onChange={(e)=>Setdata({...Data,newpass:e.target.value})}/><br/><br/>
                <input id="loginblock2" type="password" placeholder="Re-Enter Your New Password" onChange={(e)=>Setdata({...Data,cnfnewpass:e.target.value})}/><br/><br/>
                <button id="loginbutton1" style={{marginBottom:'20px'}} onClick={(e)=>Resetpassword(e)}>Reset Password</button>
            </div>
            <div id="otpblock">
                <div id="otpwindow">
                    <h2 id="otpnote">Please Enter OTP!</h2>
                    {[1, 2, 3, 4, 5, 6].map((number, index) => (
                        <input
                            key={index}
                            ref={ref => (otpRefs.current[index] = ref)}
                            className="otpinput"
                            maxLength={1}
                            value={otp[`otp${index}`]}
                            onChange={e => handleInputChange(e, index)}
                            onKeyDown={e => handleKeyDown(e, index)}
                        />
                    ))}
                    <br />
                    <button onClick={Otpfun} className="otpbtn">SUBMIT</button>
                </div>
            </div>
        </>
    )
}

export default Forgotpassword;
